pragma solidity ^0.4.19;

import "./SafeMath.sol";

contract ERC721 {
  event Transfer(address indexed _from, address indexed _to, uint256 _tokenId);
  event Approval(address indexed _owner, address indexed _approved, uint256 _tokenId);

  function balanceOf(address _owner) public view returns (uint256 _balance);
  function ownerOf(uint256 _tokenId) public view returns (address _owner);
  function transfer(address _to, uint256 _tokenId) public;
  function approve(address _to, uint256 _tokenId) public;
  function takeOwnership(uint256 _tokenId) public;
}

/**
 * @title Ownable
 * @dev The Ownable contract has an owner address, and provides basic authorization control
 * functions, this simplifies the implementation of "user permissions".
 */
contract Ownable {
  address public owner;

  event OwnershipTransferred(address indexed previousOwner, address indexed newOwner);

  /**
   * @dev The Ownable constructor sets the original `owner` of the contract to the sender
   * account.
   */
  function Ownable() public {
    owner = msg.sender;
  }


  /**
   * @dev Throws if called by any account other than the owner.
   */
  modifier onlyOwner() {
    require(msg.sender == owner);
    _;
  }


  /**
   * @dev Allows the current owner to transfer control of the contract to a newOwner.
   * @param newOwner The address to transfer ownership to.
   */
  function transferOwnership(address newOwner) public onlyOwner {
    require(newOwner != address(0));
    OwnershipTransferred(owner, newOwner);
    owner = newOwner;
  }

}

contract KittyInterface {
  function getKitty(uint256 _id) external view returns (
    bool isGestating,
    bool isReady,
    uint256 cooldownIndex,
    uint256 nextActionAt,
    uint256 siringWithId,
    uint256 birthTime,
    uint256 matronId,
    uint256 sireId,
    uint256 generation,
    uint256 genes
  );
}

contract CoinFactory is Ownable {

  using SafeMath for uint256;

  event NewCoin(uint coinId, string name, uint dna, uint16 coinType);

  uint dnaDigits = 16;
  uint dnaModulus = 10 ** dnaDigits;
  uint cooldownTime = 1 days;
  uint maxCoinType = 82;

  struct Coin {
    string name;
    uint dna;
    uint32 level;
    uint32 readyTime;
    uint16 coinType;
  }

  Coin[] public coins;

  mapping (uint => address) public coinToOwner;
  mapping (address => uint) ownerCoinCount;

  function _createCoin(string _name, uint _dna, uint16 _coinType) internal {
    uint id = coins.push(Coin(_name, _dna, 1, uint32(now + cooldownTime), _coinType)) - 1;
    coinToOwner[id] = msg.sender;
    ownerCoinCount[msg.sender].add(1);
    NewCoin(id, _name, _dna, _coinType);
  }

  function _generateRandomDna(string _str) private view returns (uint) {
    uint rand = uint(keccak256(_str));
    return rand % dnaModulus;
  }

  function createRandomCoin(string _name) public {
    //require(ownerCoinCount[msg.sender] == 0);
    uint randDna = _generateRandomDna(_name);
    randDna = randDna - randDna % 100;
    uint16 coinType = uint16(randDna % maxCoinType);
    _createCoin(_name, randDna, coinType);
  }

  function getMaxCoinType() external view returns(uint) {
      return maxCoinType;
  }

}

contract CoinFeeding is CoinFactory {

  KittyInterface kittyContract;

  modifier onlyOwnerOf(uint _coinId) {
    require(msg.sender == coinToOwner[_coinId]);
    _;
  }

  function setKittyContractAddress(address _address) external onlyOwner {
    kittyContract = KittyInterface(_address);
  }

  function _triggerCooldown(Coin storage _coin) internal {
    _coin.readyTime = uint32(now + cooldownTime);
  }

  function _isReady(Coin storage _coin) internal view returns (bool) {
      return (_coin.readyTime <= now);
  }

  function feedAndMultiply(uint _coinId, uint _targetDna, string _species) internal onlyOwnerOf(_coinId) {
    Coin storage myCoin = coins[_coinId];
    require(_isReady(myCoin));
    _targetDna = _targetDna % dnaModulus;
    uint newDna = (myCoin.dna + _targetDna) / 2;
    if (keccak256(_species) == keccak256("kitty")) {
      newDna = newDna - newDna % 100 + 99;
    }
    _createCoin("NoName", newDna, myCoin.coinType);
    _triggerCooldown(myCoin);
  }

  function feedOnKitty(uint _coinId, uint _kittyId) public {
    uint kittyDna;
    (,,,,,,,,,kittyDna) = kittyContract.getKitty(_kittyId);
    feedAndMultiply(_coinId, kittyDna, "kitty");
  }
}

contract CoinHelper is CoinFeeding {

  uint levelUpFee = 0.001 ether;

  modifier aboveLevel(uint _level, uint _coinId) {
    require(coins[_coinId].level >= _level);
    _;
  }

  function withdraw() external onlyOwner {
    owner.transfer(this.balance);
  }

  function setLevelUpFee(uint _fee) external onlyOwner {
    levelUpFee = _fee;
  }

  function levelUp(uint _coinId) external payable {
    require(msg.value == levelUpFee);
    coins[_coinId].level++;
  }

  function changeName(uint _coinId, string _newName) external aboveLevel(2, _coinId) onlyOwnerOf(_coinId) {
    coins[_coinId].name = _newName;
  }

  function changeDna(uint _coinId, uint _newDna) external aboveLevel(20, _coinId) onlyOwnerOf(_coinId) {
    coins[_coinId].dna = _newDna;
  }

  function getCoinsByOwner(address _owner) external view returns(uint[]) {
    uint[] memory result = new uint[](ownerCoinCount[_owner]);
    uint counter = 0;
    for (uint i = 0; i < coins.length; i++) {
      if (coinToOwner[i] == _owner) {
        result[counter] = i;
        counter++;
      }
    }
    return result;
  }

  function getCoin(uint _id) external view 
    returns(
        string name,
        uint256 dna,
        uint256 coinType,
        uint256 level,
        uint256 readyTime
    ) {
        Coin storage coin = coins[_id];

        name = coin.name;
        dna = uint256(coin.dna);
        coinType = uint256(coin.coinType);
        level = uint256(coin.level);
        readyTime = uint256(coin.readyTime);
  }

}

